  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0144306 includes discrete
  sample and profile data collected from PROFESSOR SIEDLECKI in the Adriatic Sea,
  Aegean Sea, Mediterranean Sea, Mediterranean Sea - Eastern Basin and Tyrrhenian
  Sea from 1988-11-17 to 1988-11-26. These data include DISSOLVED OXYGEN, NITRATE,
  Potential temperature (theta), SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE,
  pH and silicate. The instruments used to collect these data include Alkalinity titrator,
  CTD, bottle and pH sensors.nnThese data were collected by Aida F. Rios of Instituto
  de Investigaciones Marinas de Vigo as part of the Biomass-IV and Biomass-IV Expedition
  ANA Cruise data set. CDIAC associated the following cruise ID(s) with this data
  set: 67SL19881117 and Biomass-IV Expedition ANA Cruise\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
